import blog05 from "../../assets/blog05.png";

function Blog() {
  return (
    <div className="gpt3__blog section__padding">
      <div className="gpt3__blogs-container">
        <div className="gpt3__blogs-container__blog">
          <div className="gpt3__blogs-container__blog-img"></div>
          <div className="gpt3__blogs-container__blog-content">
            <p></p>
            <h3></h3>
            <p></p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Blog;
